   let respuesta = persons.filter((e)=> e.name.startsWith(props.previewList)? e.name  : null)

   console.log("RESPUESTA", respuesta[0].name)
   console.log("IONDEX", index)

   return <form onSubmit={props.onSubmitFilter}>
           <input
               placeholder="Search..."
               value={props.filterNames}
               onChange={props.onChangeFilter}
           />
           <p>Results from your contact list:</p>
           <ul>
               respuesta.map((e,i)=> )
                <li key={index}>{respuesta[0].name} - {respuesta[0].number}</li>

